import{Button}from"/scripts/src/buttons.min.js";import{convertCardToLatex}from"/scripts/src/latex.min.js";import{showPage}from"/scripts/src/loadPage.min.js";export default function load(){for(let o=1;o<=9;o++)new Button({element:document.body.querySelector(`#download-homework-${o}-button`),name:"Download Latex Source",onClick:()=>{convertCardToLatex(document.body.querySelector(`#homework-${o}-card`),"Homework "+o,"Math 341")}});showPage()}